import "./ExpenseItem.css";

const ExpenseDate = new Date(2023, 5, 9);

function Expennseiteam() {
  return (
    <div className="expense-item">
      <div>{ExpenseDate.toString()}</div>
      <div className="expense-item__description">
        <h2>Title</h2>
        <div className="expense-item__price">Expence</div>
      </div>
    </div>
  );
}
export default Expennseiteam;
// module.exports.Expennseiteam = Expennseiteam;
